import { withRouter } from 'react-router-dom';
import { Link } from 'react-router-dom';

class NavBar extends Component {
    constructor(props) {
        super(props)
        this.state = {
            grade: 0
        }
    }

    render() {
        return (
            <div style={{ margin: 10 }}>
                <Link to={{
                    pathname: "/Forum",
                    user: this.props.userData
                }}>Forum</Link>
                 &nbsp;&nbsp;&nbsp; | &nbsp;&nbsp;&nbsp;
                <Link to={{
                    pathname: "/",
                    user: this.props.userData
                }}>StudentsList</Link>

                {/* <Link data={{ userData: this.props.userData }} to="Forum">Forum</Link> &nbsp;&nbsp;&nbsp; | &nbsp;&nbsp;&nbsp;
                <Link data={{ userData: this.props.userData }} to="/StudentsList">StudentsList</Link> &nbsp;&nbsp;&nbsp; | &nbsp;&nbsp;&nbsp; */}
            </div>
        )
    }

}

export default withRouter(NavBar);
